export default class extends React.Component{
    render(){
        return(
           <div className='fondo'>
               <ul>
                    <li>
                       <a>Hombre</a>
                   </li>
                   <li>
                       <a>Mujer</a>
                   </li>
               </ul>
               <style jsx>
                   {`
                        .fondo{
                            box-shadow: 0px 0px 0px 3px;
                            width: 260px;
                            height: 33px;
                            text-align:center;
                        }

                       ul{
                           padding-left: 1px;
                       }

                        li{
                            display: inline-block;
                            margin-top: 5px;
                            margin-bottom: 5px;
                            margin-left: 15px;
                            margin-right: 15px;
                        }

                        li a:active {
                            background-color: red;
                          }
                   `}
               </style>
           </div>
        );
    }
}
